import React from 'react';
import {
    Row,
    Col,
    Button,
    ButtonToolbar,
    Table
} from 'react-bootstrap';

function TabelaPedidos() {
    const dataSource = [
        {
            numero: '1',
            cliente: 'Samuel Vasconcelos',
        },
        {
            numero: '2',
            cliente: 'Samuel Vasconcelos',
        },
        {
            numero: '3',
            cliente: 'Samuel Vasconcelos',
        },
    ];

    const columns = [
        {
            title: 'Nº',
            dataIndex: 'numero',
            key: 'numero',

        },
        {
            title: 'Cliente',
            dataIndex: 'cliente',
            key: 'cliente',
        },
        {
            title: 'Ações',
            dataIndex: 'acoes',
            key: 'acoes',
            render: _ => (
                <span>
                    <Button
                        type='primary'
                        style={{ marginLeft: '2px' }}
                        danger
                        icon={<DeleteOutlined />} 
                        />
                </span>
            ),
        },
    ];



    return (  
        <Table dataSource={dataSource} columns={columns} className='Tabela' />   
    );
}

export default TabelaPedidos;
